profile.customShaderCode:
uniform float2 iResolution;
uniform float iTime;
uniform float iSpeed;
uniform float iZoom;
uniform vec4 uColor1;
uniform vec4 uColor2;

vec4 main(float2 fragCoord) {
    float2 p = fragCoord.xy / iResolution.xy;
    float t = iTime * iSpeed * 0.5;

    for(float i = 1.0; i < 4.0; i++){
        p.x += 0.3 / i * sin(i * 3.0 * p.y + t);
        p.y += 0.3 / i * cos(i * 3.0 * p.x + t);
    }

    float v = 0.5 + 0.5 * sin(p.x * (10.0 * iZoom) + p.y);
    return mix(uColor1, uColor2, v);
}
